  let handelOnClickAdd =()=> {
      setIsAdd(true)
  }
  let handelOnClickAddNo =()=> {
      setIsAdd(false)
  }
  return (
    <>
    <Navbar/>
    <CardProfBtn/>
    </>
  )
}

export default ProfReg
